import React, { useState } from 'react';
import './Authentication.css';
import { useNavigate } from 'react-router-dom';
import DoctorComponent from '../Doctor/Doctor';
import PatientComponent from '../Patient/Patient';

function validateAadharId(aadharId) {
  const aadharRegex = /^[2-9]{1}[0-9]{3}\s{1}[0-9]{4}\s{1}[0-9]{4}$/;

  return aadharRegex.test(aadharId);
}

function Authentication() {
  const [showLoginForm, setShowLoginForm] = useState(true);
  const [isDoctor, setIsDoctor] = useState(false);
  const [mintingStatus, setMintingStatus] = useState('');
  const navigate = useNavigate();

  const toggleForm = () => {
    setShowLoginForm((prevState) => !prevState);
    console.log('Toggled');
  };

  // PATIENT FORM SUBMISSION & STORED THE INPUT DATA IN VARIABLES
  const handlePatientFormSubmit = (event) => {
    event.preventDefault();
    const username = event.target.elements.username.value;
    const aadharId = event.target.elements.aadharId.value;
    if (username && aadharId && validateAadharId(aadharId)) {
      console.log('Username:', username);
      console.log('Aadhar ID:', aadharId);
      navigate('/patient');
      setMintingStatus('Minting Successful!');
    } else {
      setMintingStatus('Please enter a valid Aadhar ID or Fill all the fields');
      alert('All fields needs to be perferct')
    }
  };

  // DOCTOR FORM SUBMISSION & STORED THE INPUT DATA IN VARIABLES
  const handleDoctorFormSubmit = (event) => {
    event.preventDefault();
    const name = event.target.elements.name.value;
    const registrationNumber = event.target.elements.registrationNumber.value;
    const registrationYear = event.target.elements.registrationYear.value;
    const smc = event.target.elements.smc.value;
    if (name && registrationNumber && registrationYear && smc) {
      console.log('Name:', name);
      console.log('Registration Number:', registrationNumber);
      console.log('Registration Year:', registrationYear);
      console.log('SMC:', smc);
      setMintingStatus('Minting Successful! Wait for approval.');
      setIsDoctor(true);
    } else {
      setMintingStatus('Fill all the fields');
      alert('All fields are mandatory');
    }
  };

  // Display minting status on console when it is updated
  console.log('Minting Status:', mintingStatus);

  return (
    <>
      {isDoctor ? (
        <DoctorComponent />
      ) : (
        <div className="auth-container">
          <div className="toggle-btn-container">
            <button id="toggle-btn" onClick={toggleForm}>
              {showLoginForm ? '! Patient Registration' : '! Doctor Registration'}
            </button>
            {showLoginForm ? (
              <form onSubmit={handlePatientFormSubmit}>
                <label>
                  User Name:
                  <input type="text" name="username" placeholder="Enter a username" />
                </label>
                <label>
                  Enter Unique ID:
                  <input type="text" name="aadharId" placeholder="37XX 94XX 12XX" />
                </label>
                <button type="submit">User Mint!</button>
              </form>
            ) : (
              <form onSubmit={handleDoctorFormSubmit}>
                <label>
                  Name:
                  <input type="text" name="name" placeholder="Enter Your Name" />
                </label>
                <label>
                  Registration Number:
                  <input type="text" name="registrationNumber" placeholder="Enter Your Registration Number" />
                </label>
                <label>
                  Registration Year:
                  <input type="date" name="registrationYear" placeholder="Enter Registaration Year"  max={new Date().toISOString().split('T')[0]} />
                </label>
                <label>
    State Medical Council:
    <select name="smc" id="smc-select">
      <option value="">-- Select State Medical Council --</option>
           <option value="1">Andhra Pradesh Medical Council</option>
           <option value="2">Arunachal Pradesh Medical Council</option>
           <option value="3">Assam Medical Council</option>
      {/* <!--<option value="27">Bareilly Medical Council</option>--> */}
            <option value="28">Bhopal Medical Council</option>
            <option value="4">Bihar Medical Council</option>
            <option value="29">Bombay Medical Council</option>
            <option value="30">Chandigarh Medical Council</option>
            <option value="5">Chattisgarh Medical Council</option>
            <option value="6">Delhi Medical Council</option>
      {/* <!--<option value="31">Dental Council of India</option>
                                  <option value="39">General Medical Council</option>--> */}
                                  <option value="7">Goa Medical Council</option>
                                  <option value="8">Gujarat Medical Council</option>
                                  <option value="9">Haryana Medical Councils</option>
                                  <option value="10">Himachal Pradesh Medical Council</option>
                                  <option value="45">Hyderabad Medical Council</option>
                                  <option value="11">Jammu & Kashmir Medical Council</option>
                                  <option value="12">Jharkhand Medical Council</option>
                                  <option value="13">Karnataka Medical Council</option>
                                  {/* <!--<option value="14">Kerala Medical Council</option>-->> */}
                                  <option value="15">Madhya Pradesh Medical Council</option>
                                  <option value="36">Madras Medical Council</option>
                                  <option value="35">Mahakoshal Medical Council</option>
                                  <option value="16">Maharashtra Medical Council</option>
                                  <option value="26">Manipur Medical Council</option>
                                  <option value="46">Medical Council of India</option>
                                  <option value="47">Medical Council of Tanganyika</option>
                                  <option value="42">Mizoram Medical Council</option>
                                  <option value="37">Mysore Medical Council</option>
                                  <option value="41">Nagaland Medical Council</option>
                                  <option value="17">Orissa Council of Medical Registration</option>
                                  <option value="38">Pondicherry Medical Council</option>
                                  <option value="18">Punjab Medical Council</option>
                                  <option value="19">Rajasthan Medical Council</option>
                                  <option value="20">Sikkim Medical Council</option>
                                  <option value="21">Tamil Nadu Medical Council</option>
                                  <option value="43">Telangana State Medical Council</option>
                                  {/* <option value="33">Travancore Cochin Medical Council</option> */}
                                  <option value="50">Travancore Cochin Medical Council, Trivandrum</option>
                                  <option value="22">Tripura State Medical Council </option>
                                  <option value="23">Uttar Pradesh Medical Council</option>
                                  <option value="24">Uttarakhand Medical Council</option>
                                  <option value="40">Vidharba Medical Council</option>
                                  <option value="25">West Bengal Medical Council</option>
      </select>
  </label>
  <button type="submit">Doctor Mint!</button>
</form>
            )}
          </div>
        </div>
      )}
    </>
  );
}

export default Authentication;
